import React, {useEffect, useState} from "react";
import {Card, Container, Search} from "semantic-ui-react";
import API from "../../api";
import "./style.css";
async function fetchDataCall() {
  try {
    const response = await API.get("/feedbacks");
    return response;
  } catch (error) {
    console.log("error", error);
  }
}

function FeedbackList() {
  const [data, setData] = useState([]);
  const [values, setValues] = useState({
    isLoading: false,
    results: [],
    value: "",
  });

  const handleResultSelect = (e, {result}) => setValues({value: result.title});

  handleSearchChange = (e, {value}) => {
    setValues({isLoading: true, value});

    setTimeout(() => {
      if (this.state.value.length < 1) return setValues(initialState);

      const re = new RegExp(_.escapeRegExp(this.state.value), "i");
      const isMatch = (result) => re.test(result.title);

      setValues({
        isLoading: false,
        results: _.filter(data, isMatch),
      });
    }, 300);
  };

  useEffect(() => {
    const getData = async () => {
      let data = await fetchDataCall();
      setData(data);
    };
    getData();
  }, []);

  let FeedbackListToRender;
  if (data !== [] && data.data !== undefined) {
    FeedbackListToRender = data.data.data.map((feedback) => (
      <Card fluid>
        <Card.Content>
          <Card.Header>{feedback.attributes.body}</Card.Header>
          <Card.Description>
            <p>
              <b>User:</b> {feedback.attributes.user.firstname}{" "}
              {feedback.attributes.user.lastname}
            </p>
            <p>
              <b>Email:</b> {feedback.attributes.user.email}{" "}
            </p>
          </Card.Description>
        </Card.Content>
      </Card>
    ));
  }

  return (
    <Container className='main-container'>
      <Search
        input={{icon: "search", iconPosition: "left"}}
        loading={isLoading}
        onResultSelect={handleResultSelect}
        onSearchChange={_.debounce(handleSearchChange, 500, {
          leading: true,
        })}
        results={results}
        value={value}
      />
      <Card.Group>
        <pre style={{overflowX: "auto"}}>
          {JSON.stringify(state, null, 2)}
        </pre>
      </Card.Group>
      <Card.Group>{FeedbackListToRender}</Card.Group>
    </Container>
  );
}

export default FeedbackList;
